import React from "react";
import { Container } from "react-bootstrap";

const Footer = () => {
  return (
    <>
      <Container className="justify-content-center ">
        <Raw className="justify-content-center ">
          <h6>footer</h6>
        </Raw>
      </Container>
    </>
  );
};

export default Footer;
